import { Link } from "react-router-dom";


export const Navbar = () => {

    return (
    <div className="navbar">
    <Link to="/">Home</Link>
    <Link to="/create-workout">Create Workout</Link>
    <Link to="/saved-workout">Saved Workouts</Link>
    <Link to="/auth">Login/Register</Link>
    </div>
    );
};
